import React,{useState} from 'react'
import { FlatList, StyleSheet, View,TouchableOpacity, RefreshControl      } from 'react-native'
import TelaJardimItemLista from './TelaJardimItemLista'


const DATA_JARDINS = [
    {
        id: 'c54c3d99-3380-4623-b918-fda7508ac65c',
        img: 'data:image/png;base64,',
        name: 'Orquidea',
        date: '10/10/2020',
        monitor: 'Ligado'
    }]




const style = StyleSheet.create({

})

export default ({navigation, data}) => {
    const [refreshing, setRefreshing] = useState(false)
    const [listData, setListData] = useState(data)

    const onRefresh = React.useCallback(async () => {
        setRefreshing(true)

        return fetch('https://plantgo.herokuapp.com/garden', {
            method: 'POST',
            headers: {
                Accept: 'application/json',
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                login: 'cleito'
            })
        })
            .then((response) => response.json())
            .then((json) => {
                setListData(json)
                setRefreshing(false)})
            .catch((error) => console.error(error))
    }, [refreshing])
    const renderItem = ({ item }) => (
        <TouchableOpacity
            onPress = {() => navigation.navigate('TelaPlanta',{
                id: item.id,
                img: item.img
            })}
        >

            <TelaJardimItemLista
                navigation={navigation}
                id={item.id}
                name={item.name}
                date={item.date}
                monitor={item.monitor}
                img={item.img}
                especie = {item.specie}
            />
        </TouchableOpacity>
    );
    return (
        <View style = {{flex:1}}>
            <FlatList
                data={listData}
                renderItem={renderItem}
                keyExtractor={item => item.id} 
                refreshControl={<RefreshControl refreshing={refreshing} onRefresh={onRefresh} />}
                />

            
        </View>
    )
}
